  const [characters, setCharacters] = useState([]);

  const onSearch = (newCharacter) => {
    setCharacters([
      ...characters,newCharacter
          ]);
  };
  return (
    <div className="App">
      <Nav onSearch={onSearch}/>
      <Cards characters={characters} />
    </div>
  );
}

